import React from 'react'

const Header = () => {
  return (
    <div className='bg-green-500 w-full inline-flex  '>
        <h5 className='ml-20 mt-10'>Good Morning ! </h5>
        <div className='bg-yellow-50 h-12 content-center rounded-md'>
            <h5 className='mx-2'>John Doe</h5>
            <p className='mx-2'>johndoe@.com</p>
            

        </div>
     

    </div>
  )
}

export default Header
